import React, { Component } from "react";

export default class Count extends Component {
  state = { count: 0 };
  render() {
    return (
      <div>
        <h1>当前求和为：0</h1>
        <select value="0">
          <option value="1">1</option>
          <option value="2">2</option>
          <option value="3">3</option>
          <option value="4">4</option>
        </select>
        &nbsp;
        <button>+</button>&nbsp;
        <button>-</button>&nbsp;
        <button>当前求和为奇数再加</button>&nbsp;
        <button>异步加</button>
      </div>
    );
  }
}
